import logo from './logo.svg';
import './App.css';
import Navbar from './components/Navbar';
import Socials from './components/Socials';
function App() {
  return (
          <div className="App">
            <div display="flex" text-align="center" width="10%">
              <Socials/>
            </div>
            <Navbar/>
          <img src={logo} className="App-logo" alt="logo" />
              <div id="content">
                <div id="aboutmecontent">
                </div>
              </div>           
            <footer>Copyright &copy; Alex Barbosa</footer>
          </div>
  );
}

export default App;
